'use strict';

/**
* Evaluate the natural logarithm of the cumulative distribution function (CDF) for a beta prime distribution.
*
* @module @stdlib/math/base/dist/betaprime/logcdf
*
* @example
* var logcdf = require( '@stdlib/math/base/dist/betaprime/logcdf' );
*
* var y = logcdf( 0.5, 1.0, 1.0 );
* // returns ~-1.099
*
* y = logcdf( 0.5, 2.0, 4.0 );
* // returns ~-0.618
*
* @example
* var factory = require( '@stdlib/math/base/dist/betaprime/logcdf' ).factory;
*
* var logcdf = factory( 0.5, 0.5 );
*
* var y = logcdf( 0.8 );
* // returns ~-0.766
*
* y = logcdf( 0.3 );
* // returns ~-1.142
*/

// MODULES //

var setReadOnly = require( '@stdlib/utils/define-read-only-property' );
var logcdf = require( './logcdf.js' );
var factory = require( './factory.js' );


// MAIN //

setReadOnly( logcdf, 'factory', factory );


// EXPORTS //

module.exports = logcdf;
